BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "DIM_CANAL" (
	"id_canal"	INTEGER,
	"canal_distribucion"	TEXT NOT NULL,
	"tipo_canal"	TEXT,
	"descripcion"	TEXT,
	"comision_porcentaje"	REAL,
	"es_activo"	BOOLEAN,
	PRIMARY KEY("id_canal")
);
CREATE TABLE IF NOT EXISTS "DIM_CLIENTE" (
	"id_cliente"	INTEGER,
	"nombre_cliente"	TEXT NOT NULL,
	"tipo_cliente"	TEXT,
	"segmento"	TEXT,
	"tamaño_empresa"	TEXT,
	"id_pais"	INTEGER,
	"nombre_pais"	TEXT,
	"region"	TEXT,
	"fecha_registro"	DATE,
	"estado_cliente"	TEXT,
	PRIMARY KEY("id_cliente")
);
CREATE TABLE IF NOT EXISTS "DIM_GEOGRAFIA" (
	"id_geografia"	INTEGER,
	"pais"	TEXT NOT NULL,
	"region"	TEXT,
	"continente"	TEXT,
	"zona_comercial"	TEXT,
	"codigo_iso"	TEXT,
	"es_mercado_principal"	BOOLEAN,
	PRIMARY KEY("id_geografia")
);
CREATE TABLE IF NOT EXISTS "DIM_PRODUCTO" (
	"id_producto"	INTEGER,
	"nombre_producto"	TEXT NOT NULL,
	"tipo_harina"	TEXT,
	"peso_kg"	REAL,
	"categoria"	TEXT,
	"subcategoria"	TEXT,
	"marca"	TEXT,
	"es_premium"	BOOLEAN,
	"unidad_medida"	TEXT,
	PRIMARY KEY("id_producto")
);
CREATE TABLE IF NOT EXISTS "DIM_TIEMPO" (
	"id_tiempo"	INTEGER,
	"fecha_completa"	DATE NOT NULL,
	"año"	INTEGER NOT NULL,
	"mes"	INTEGER NOT NULL,
	"dia"	INTEGER NOT NULL,
	"trimestre"	INTEGER NOT NULL,
	"nombre_mes"	TEXT NOT NULL,
	"nombre_dia_semana"	TEXT NOT NULL,
	"numero_semana"	INTEGER NOT NULL,
	"periodo_fiscal"	TEXT NOT NULL,
	"es_fin_semana"	BOOLEAN NOT NULL,
	"es_feriado"	BOOLEAN NOT NULL,
	"turno_trabajo"	INTEGER DEFAULT 1,
	"periodo_estacional"	TEXT,
	PRIMARY KEY("id_tiempo")
);
CREATE TABLE IF NOT EXISTS "DIM_TRANSPORTE" (
	"id_transporte"	INTEGER,
	"medio_transporte"	TEXT NOT NULL,
	"tipo_transporte"	TEXT,
	"costo_promedio_km"	REAL,
	"capacidad_ton"	REAL,
	"es_internacional"	BOOLEAN,
	PRIMARY KEY("id_transporte")
);
CREATE TABLE IF NOT EXISTS "FACT_VENTAS" (
	"id_venta"	INTEGER,
	"id_tiempo"	INTEGER,
	"id_producto"	INTEGER,
	"id_cliente"	INTEGER,
	"id_geografia"	INTEGER,
	"id_canal"	INTEGER,
	"id_transporte"	INTEGER,
	"nro_pedido"	TEXT,
	"cantidad_sacos"	INTEGER,
	"cantidad_toneladas"	REAL,
	"precio_por_saco"	REAL,
	"total_venta"	REAL,
	"costo_producto"	REAL,
	"margen_bruto"	REAL,
	"descuento_aplicado"	REAL,
	"moneda"	TEXT,
	"tipo_cambio"	REAL,
	"estado_venta"	TEXT,
	"fecha_entrega"	DATE,
	"dias_credito"	INTEGER,
	"comision_venta"	REAL,
	PRIMARY KEY("id_venta"),
	FOREIGN KEY("id_canal") REFERENCES "DIM_CANAL"("id_canal"),
	FOREIGN KEY("id_cliente") REFERENCES "DIM_CLIENTE"("id_cliente"),
	FOREIGN KEY("id_geografia") REFERENCES "DIM_GEOGRAFIA"("id_geografia"),
	FOREIGN KEY("id_producto") REFERENCES "DIM_PRODUCTO"("id_producto"),
	FOREIGN KEY("id_tiempo") REFERENCES "DIM_TIEMPO"("id_tiempo"),
	FOREIGN KEY("id_transporte") REFERENCES "DIM_TRANSPORTE"("id_transporte")
);
COMMIT;
